import React from 'react';
import {Link} from 'react-router-dom';

const Menu = () =>{
    return(
        <>
        <Link to='/'> About Us</Link>
        <Link to='/contact'> Contact Us</Link>

        {/*<a href ='/' > AboutUS </a>
        <a href ='/contact' > ContactUS </a>*/}

        </>
    );
};

export default Menu;
